REPLACE INTO `mob_chat_db` VALUES(1,0xFF0000,'Weakling! Challenge me if you have any courage!');
REPLACE INTO `mob_chat_db` VALUES(2,0xFF0000,'Impressive! I wonder how far your recklessness will take you.');
REPLACE INTO `mob_chat_db` VALUES(3,0xFF0000,'I almost pity how outmatched you are against me. Now prepare for my attack!');
REPLACE INTO `mob_chat_db` VALUES(4,0xFF0000,'My loyal servants! Welcome them with a painful death!');
REPLACE INTO `mob_chat_db` VALUES(5,0xFF0000,'Dont you run away!');
REPLACE INTO `mob_chat_db` VALUES(6,0xFF0000,'You worthless humans. Your so-called holy powers have no effect on me!');
REPLACE INTO `mob_chat_db` VALUES(7,0xFF0000,'Useless underlings!...Well');
REPLACE INTO `mob_chat_db` VALUES(8,0xFF0000,'Pray to your gods!');
REPLACE INTO `mob_chat_db` VALUES(9,0xFF0000,'Do you still think youre a match to me?!');
REPLACE INTO `mob_chat_db` VALUES(10,0xFF0000,'Vanish!');
REPLACE INTO `mob_chat_db` VALUES(11,0xFF0000,'Lets see how long you can endure my power!');
REPLACE INTO `mob_chat_db` VALUES(12,0xFF0000,'Is this all youve got?!');
REPLACE INTO `mob_chat_db` VALUES(13,0xFF0000,'Youre tickling me!');
REPLACE INTO `mob_chat_db` VALUES(14,0xFF0000,'This is how you attack? Watch and learn');
REPLACE INTO `mob_chat_db` VALUES(15,0xFF0000,'Its time to finish the game!');
REPLACE INTO `mob_chat_db` VALUES(16,0xFF0000,'Oh');
REPLACE INTO `mob_chat_db` VALUES(17,0xFF0000,'No');
REPLACE INTO `mob_chat_db` VALUES(18,0xFF0000,'I can never die! Ill be coming back for you!');
REPLACE INTO `mob_chat_db` VALUES(19,0xFF0000,'I was born to conquer this world! None shall stop me!');
REPLACE INTO `mob_chat_db` VALUES(20,0xFF0000,'Your days are numbered!');
REPLACE INTO `mob_chat_db` VALUES(21,0xFF0000,'Pulse Strike! My fingers tear steel!');
REPLACE INTO `mob_chat_db` VALUES(22,0xFF0000,'Hahaha');
REPLACE INTO `mob_chat_db` VALUES(23,0xFF0000,'Enjoy your time on the mortal plane while you can');
REPLACE INTO `mob_chat_db` VALUES(24,0xFF0000,'When are you going to learn your lesson? In death?');
REPLACE INTO `mob_chat_db` VALUES(25,0xFF0000,'No... I cant lose! I wont beg for my life! Im not running away! I dont accept this as defeat!');
REPLACE INTO `mob_chat_db` VALUES(26,0xFF0000,'Argh... I... Im weakening...');
REPLACE INTO `mob_chat_db` VALUES(27,0xFF0000,'What do you want from me?');
REPLACE INTO `mob_chat_db` VALUES(28,0xFF0000,'No! I didnt do this! Hes the one who planned out all this!');
REPLACE INTO `mob_chat_db` VALUES(29,0xFF0000,'I just wanted to find peace..!  Thats why I have been fleeing away!');
REPLACE INTO `mob_chat_db` VALUES(30,0xFF0000,'Ahhhh!!! Now');
REPLACE INTO `mob_chat_db` VALUES(31,0xFF0000,'Annoying flies!! Get off of me!');
REPLACE INTO `mob_chat_db` VALUES(32,0xFF0000,'Suffer in Hell!');
REPLACE INTO `mob_chat_db` VALUES(33,0xFF0000,'Mwahahaha! Taste the anger of the earth!!!');
REPLACE INTO `mob_chat_db` VALUES(34,0xFF0000,'No... I wont accept this as defeat!');
REPLACE INTO `mob_chat_db` VALUES(35,0xFF0000,'Will it ease your loneliness to hit me?  Why dont you stay here with me forever');
REPLACE INTO `mob_chat_db` VALUES(36,0xFF0000,'You will forgot the meaning of time.  I wonder how long can you last in here...');
REPLACE INTO `mob_chat_db` VALUES(37,0xFF0000,'Is there anyone waiting for you outside of here?  Throw them all away');
REPLACE INTO `mob_chat_db` VALUES(38,0xFF0000,'Discard your life and stay confined here.  You will yearn for freedom in captivity !!');
REPLACE INTO `mob_chat_db` VALUES(39,0xFF0000,'How much will the outside world change if you stay here in solitude for one thousand years?');
REPLACE INTO `mob_chat_db` VALUES(40,0xFF0000,'Yes! Yearn for your freedom from this confined place');
